import Footer from "./components/Footer";
import Header from "./components/Header";
import "./styles/reset.scss";
import "./styles/style.scss";

const App = () => {
    return (
        <div className="App">
            <div className="bg">
                <Header />
                <Footer />
            </div>
        </div>
    );
};

export default App;
